CBRE are pleased to offer 142 Killeaton Street, ST IVES (the Site) to the market for sale. This DA approved townhouse site is well positioned only a short walk to the St Ives Shopping Village. The site is the perfect opportunity to develop a high end medium density townhouse development which captures the essence of the cosy suburban North Shore lifestyle.

The site will be sold via an Expression of Interest campaign closing
on Thursday 18 June 2020 at 3pm (AEST).

Key attributes of the site include:
•	Site area of 1,699sqm*;
•	DA approval for 10 townhouses with basement parking;
•	CC drawings and tender documents drafted and finalised;
•	Approved GFA of 1,348sqm*
•	Regular shaped site with wide street frontage;
•	Less than 1km* from St Ives Shopping Village;
•	1.5km* from Pymble Golf Club;
•	Top public and private schools within close proximity; and
•	Significant demand for high end housing stock from both families and downsizers.

